/* wfobjlex_destroy is for both reentrant and non-reentrant scanners. */
int wfobjlex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		wfobj_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		wfobjpop_buffer_state();
	}

	/* Destroy the stack itself. */
	wfobjfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * wfobjlex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

