int 
WFObjInput(char *buffer, int max_size)
{
    int count=0,sfail=0;

    while (max_size && !(sfail=yyInputStream->fail()))
    {
	int c = yyInputStream->get();
	if (c == EOF) { sfail=true; break; }
	buffer[count++] = c;
	max_size--;
    }

    if (sfail) buffer[count]=0;
    return count;
}

